import React from 'react';
import {
	Route,
	BrowserRouter,
	RouteComponentProps,
	Switch,
	Redirect,
} from 'react-dom';
import './App.css';
import Sider from './pages/Dashboard';

function App() {
	return (
		<>
			<BrowserRouter>
				<Switch>
					<Route path='/'>
						<Sider />
					</Route>

					{/* <Route path={"/login"} render={} /> */}
					{/* <Route path={"/register"} render={} /> */}
					<Route path='/dashboard' render={Sider} />
					{/* <Route path={"course"} render={} /> */}
					<Redirect to='404' />
				</Switch>
			</BrowserRouter>
		</>
	);
}
export default App;
